scripts/CloudFunding.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract CloudFunding {

    struct Investor {
        address addr; // 투자자 주소
        uint amount; // 투자액
    }

    // investors 배열
    mapping(uint => Investor) public investors; // 투자자 추가할 때 key 증가

    address public owner; // 컨트랙트 소유자
    uint public numInvestors; // 투자자 수
    uint public deadline; // 마감일
    string public status; // 모금활동 상태(Funding, Campaign Succeeded, Campaign Failed)
    bool public ended; // 모금 종료여부
    uint public goalAmount; // 목표액
    uint public totalAmount; // 총 투자액

    modifier onlyOwner() {
        require(msg.sender == owner, "Error: caller is not the owner");
        _;
    }

    // 초기 설정: 컨트랙트의 소유자를 설정하거나 목표 금액, 마감일 등을 설정
    constructor(uint _duration, uint _goalAmount) {
        owner = msg.sender;

        deadline = block.timestamp + _duration;
        goalAmount = _goalAmount * 1 ether;
        status = "Funding";
        ended = false;

        numInvestors = 0;
        totalAmount = 0;
    }

    // 투자자가 투자할 때 호출하는 함수
    function fund() public payable {
        require(!ended, "Funding has ended"); // 모금이 끝남
        require(block.timestamp < deadline, "Deadline has passed"); // 마감일 지남
        require(msg.value > 0, "Investment must be greater than 0"); // 송금은 0보다 커야 함

        investors[numInvestors] = Investor(msg.sender, msg.value); // investors array에 투자하는 만큼 쌓아가기
        numInvestors++;
        totalAmount += msg.value;
    }

    // 소유자가 모금을 종료할 때 호출하는 함수
    function checkGoalReached() public onlyOwner {
        require(block.timestamp >= deadline, "Campaign is still ongoing");
        require(!ended, "Campaign already ended");

        if (totalAmount >= goalAmount) {
            status = "Campaign Succeeded";
        } else {
            status = "Campaign Failed";
        }

        ended = true;
    }

}

